Protect the rule of law including the independence of the Judiciary, and to progressively enhance Hong Kong’s legal system and infrastructure. This is achieved
through, inter alia:
• providing legal advice to government bureaux and departments and representing Government in courts, in accordance with the provisions of the Basic Law (including the provisions which safeguard the rule of law and human rights);
• providing a modern first-class prosecution service by seeking to ensure that prosecutions are conducted fairly with professionalism and integrity, and within the framework of defined and clear prosecution policy guidelines, as well as in accordance with Article 63 of the Basic Law;
• ensuring legislation that implements Government policy is completed on time and is readily accessible; and
• enhancing the competitiveness of Hong Kong as a centre for international legal and dispute resolution services in the Asia Pacific region.

